pragma solidity 0.5.7;

interface VerifiedKYC{

     function setStatus(address _client, uint _status) external;

     function getStatus(address _client) external view returns(uint);

     function setFile(address _client, string calldata _file) external;

     function getFile(address _client) external view returns(string memory);

     function setFATCA(address _client, string calldata _file) external;

     function getFATCA(address _client) external view returns(string memory);

     function setCRS(address _client, string calldata _file) external;

     function getCRS(address _client) external view returns(string memory);

     function setPhotoID(address _client, string calldata _file) external;

     function getPhotoID(address _client) external view returns(string memory);

     function setVideoID(address _client, string calldata _file) external;

     function getVideoID(address _client) external view returns(string memory);

     function setAddress(address _client, string calldata _file) external;

     function getAddress(address _client) external view returns(string memory);

     /*function setKyc(address _client, bytes32 _file, bytes32 _fatca, 
                    bytes32 _crs, bytes32 _photoId, bytes32 _videoId, 
                    bytes32 _address, bytes32 _country) external;

     function getKyc(address _client) external view returns(bytes32, bytes32, bytes32, bytes32, 
                                                            bytes32, bytes32, bytes32);*/

     function setCountry(address _client, bytes32 _country) external;

     function getCountry(address _client) external view returns(bytes32);

     function setName(address _client, bytes32 _name, bytes32 _surname) external;

     function getName(address _client) external view returns(bytes32, bytes32);

     function setPhone(address _client, bytes32 _phone) external;

     function getPhone(address _client) external view returns(bytes32);

     function setEmail(address _client, bytes32 _email) external;

     function getEmail(address _client) external view returns(bytes32);

     function setKYCPaid(address _client, bytes32 _paid) external;

     function getKYCPaid(address _client) external view returns(bytes32);
     
}
